import styled from 'styled-components';

export const Container = styled.div`
    width: 20%;
    height: 10%;
    left: 10%;
    top: 5%;
    position: relative;
    margin: 20px;
    display: inline-block;

    h1 {
        text-align: center;
    }

    Button {
        margin: 5px;
    }

    div {
        display: block;
    }
`;
